import '../App.css';

const Header = () => {
  return (
    <>
      <div className='header'>
        <a className='myName'>Vitor Souza</a>
        <a className='headerItem'>Inicio</a>
        <a className='headerItem'>Projetos</a>
        <a className='headerItem'>Sobre mim</a>
      </div>
    </>
    );
};

export default Header;
